import React from "react";
import Table from "@mui/material/Table/Table"; // <table>
import TableHead from "@mui/material/TableHead/TableHead"; // <thead>
import TableCell from "@mui/material/TableCell/TableCell"; // <th>
import TableRow from "@mui/material/TableRow/TableRow"; // <tr>

const Show = (props: any) => {
  return (
    <div>
    <Table>
    <TableHead>
      <TableRow>
      <TableCell><img src={props.image} alt='cryptocurrency'/></TableCell>
      <TableCell><p>{props.name}</p></TableCell>
      <TableCell><p>{props.symbol.toUpperCase()}</p></TableCell>
      <TableCell><p>${props.price}</p> </TableCell>
      <TableCell><p>{props.priceChange}%</p></TableCell>
      </TableRow>
      </TableHead>
      </Table>
    </div>
  );
};

export default Show;
